import React from "react";
function Def(){
    return(
        <div>
            <label>Email:</label>
            <input type="email"/>
            <br/><br/>
            <label>password:</label>
            <input type="password"/>
            <br/><br/>
            <button>SighnUp</button>
            <button>Login</button>
            <button>Logout</button>
        </div>
    )
}
export default Def;
